Fixpoint makearray (n : nat) :=
  match n with
  | O => nil
  | S n => 0::(makearray n)
  end.

Fixpoint solvethis (A : LF) (max : nat) :=
  let natoms := List.length (filter (fun x => Nat.eqb (length_lf x) 0) (subformulas A)) in
  depfirst A (makearray natoms) max.


